import React from 'react';
import {Link} from 'react-router-dom';

const Header = () =>{
    const style ={
        display: 'inline-block',
        margin:10,
        marginBottom:30
    }

    return(
        <div>
          <h3><Link to='/'>Home</Link></h3>  
          <h3><Link to='/jokes'>Jokes</Link></h3>
          <h3><Link to='/jokesTen'>Ten Jokes</Link></h3>
        </div>
    )

}
export default Header;
